import React from 'react';
import { Provider } from 'react-redux';
import logo from './logo.svg';
import './App.css';
import UserContainer from './components/UserContainer';

function App() {
  return (
    <Provider>
      <div className="App">
        <UserContainer/>
      </div>
    </Provider>
  );
}

export default App;
